drop database if exists comercio;
create database comercio;
use comercio;

create table minerio (
  idminerio int NOT NULL AUTO_INCREMENT,
  nome varchar(45) NOT NULL,
  PRIMARY KEY (idminerio),
  UNIQUE KEY idminerio_UNIQUE (idminerio),
  UNIQUE KEY nome_UNIQUE (nome)
);

CREATE TABLE continente(
  idcontinente int NOT NULL AUTO_INCREMENT,
  nome varchar(45) NOT NULL,
  area int NOT NULL,
  numvulcoesativos int NOT NULL,
  PRIMARY KEY (idcontinente),
  UNIQUE KEY idcontinente_UNIQUE (idcontinente),
  UNIQUE KEY nome_UNIQUE (nome)
);

CREATE TABLE pais (
  idPais int NOT NULL AUTO_INCREMENT,
  nome varchar(60) NOT NULL,
  capital varchar(60) NOT NULL,
  moeda varchar(60) DEFAULT NULL,
  continente_id int NOT NULL references continente(idcontinente),
  PRIMARY KEY (idPais),
  UNIQUE KEY nome_UNIQUE (nome),
  UNIQUE KEY capital_UNIQUE (capital)
  );

CREATE TABLE `producao_minerio` (
  idproducao_minerio int NOT NULL AUTO_INCREMENT , 
  minerio_id int NOT NULL references minerio(idminerio),
  idPais int NOT NULL references pais(idPais),
  ano year NOT NULL,
  qtd_Producao float NOT NULL CHECK (qtd_Producao > 0),
  PRIMARY KEY (idproducao_minerio, minerio_id, idPais),
  UNIQUE KEY idproducao_minerio_UNIQUE (idproducao_minerio)
  );
  





